const Box = (props) => {
    return (
        <div className="box">
            <div>
                <label>아이디</label>
                <input></input>
            </div>
            <div>
                <label>비밀번호</label>
                <input></input>
            </div>
            <button>로그인</button>
            <style jsx>{`
                .box {
                    width: 300px;
                    height: 300px;
                    border: 1px solid #000;
                }
            `}</style>
        </div>
    );
};

export default Box;
